        <style>
            :root {
                --blue: rgb(114, 137, 218);
                --white: rgb(233, 233, 233);
                --grey: rgb(153, 170, 181);
                --light-black: rgb(44, 47, 51);
                --black: rgb(35, 39, 42);
                --dark-black: rgb(27, 30, 32);
                --red: rgb(255, 107, 107);
                --font: 'Gabarito', sans-serif;
            }

            html,
            body {
                background-color: var(--light-black);
                color: var(--white);
                padding: 0px;
                margin: 0px;
            }

            html,
            body,
            button,
            input,
            select,
            textarea {
                font-family: var(--font);
            }

            a {
                text-decoration: none;
                color: var(--blue);
            }

            a:hover,
            a.clicked {
                border-bottom-style: dashed;
                border-bottom-width: 2px;
                border-bottom-color: var(--blue);
                cursor: pointer;
            }

            body {
                text-align: center;
                padding: 10px;
            }

            img {
                width: 100px;
                height: 100px;
                border-radius: 100%;
                margin-top: 20px;
            }

            p {
                font-size: large;
            }

            #swag {
                color: var(--red);
            }

            b,
            h1 {
                letter-spacing: 2px;
            }

            #slogan {
                font-size: larger;
            }
        </style>
    </head>
